import React from "react";
import "./Frame32.css";

function Frame32(props) {
  const { blockUser, className } = props;

  return (
    <div className={`frame-34 ${className || ""}`}>
      <div className="block-user valign-text-middle ibmplexsans-semi-bold-quarter-spanish-white-16px">{blockUser}</div>
    </div>
  );
}

export default Frame32;
